                <h1>0</h1>
                <div className="btn_div">
                    <button><i className="fa fa-plus" aria-hidden="true"></i></button>
                    <button><i className="fa fa-trash" aria-hidden="true"></i></button>
                </div>
            </div>
        </>
    );
}

